o=A.af("\u0130badet Rehberim ekibi olarak, kullan\u0131c\u0131lar\u0131m\u0131z\u0131n gizlili\u011fine ve ki\u015fisel verilerinin g\xfcvenli\u011fine b\xfcy\xfck \xf6nem veriyoruz. Bu Gizlilik Politikas\u0131, mobil uygulamam\u0131z\u0131 kulland\u0131\u011f\u0131n\u0131zda verilerinizin nas\u0131l topland\u0131\u011f\u0131n\u0131, kullan\u0131ld\u0131\u011f\u0131n\u0131, payla\u015f\u0131ld\u0131\u011f\u0131n\u0131 ve korundu\u011funu a\xe7\u0131klamaktad\u0131r.",b6,b6,b6,c0,b6,b6)
