a9=A.af("Kullan\u0131m ko\u015fullar\u0131na ayk\u0131r\u0131 hareket eden kullan\u0131c\u0131lar\u0131n hesaplar\u0131 (\xf6zellikle uygunsuz i\xe7erik bildirimi veya raporlama durumlar\u0131nda) haber verilmeksizin ask\u0131ya al\u0131nabilir veya silinebilir.",c1,c1,c1,c5,c1,c1)
b0=A.af("Hizmetin Durdurulmas\u0131:",c1,c1,c1,c6,c1,c1)
