b6=A.af("Uygulama i\xe7indeki asistan, yapay zeka teknolojisi ile \xe7al\u0131\u015fmaktad\u0131r. Verdi\u011fi yan\u0131tlar\u0131n %100 do\u011frulu\u011fu garanti edilmez. Asistan\u0131n dini konulardaki yorumlar\u0131 referans al\u0131narak ibadet de\u011fi\u015fikli\u011fine gidilmemelidir.",c1,c1,c1,c5,c1,c1)
